import React from 'react';
import { Route, Switch } from 'react-router-dom';

import Header from './components/Header';
import LogSleep from './components/LogSleep';
import SleepData from './components/SleepData';

import './App.css';

function App() {
  return (
    <div className="App">
      <Header />

      <Switch>
        <Route exact path='/'>
          <LogSleep />
        </Route>
        <Route path='/data'>
          <SleepData />
        </Route>
        <Route path='/sleepreview'>
          <SleepReview />
        </Route>
      </Switch>


    </div >

  );
}

export default App;
